	add("sophisticate", "{\"term\":\"sophisticate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"c.1400, \u0026quot;make impure by admixture,\u0026quot; from Medieval Latin sophisticatus, past participle of sophisticare (see sophistication). From c.1600 as \u0026quot;corrupt, delude by sophistry;\u0026quot; from 1796 as \u0026quot;deprive of simplicity.\u0026quot; Related: Sophisticated; sophisticating. As a noun meaning \u0026quot;sophisticated person\u0026quot; from 1921.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A worldly-wise perso\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"w:SpongeBob Spongebob Squarepants\u0027\u0027\u0027, episode \u0027Sailor Mouth\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Patrick: \u0027Because classy \u0027\u0027sophisticates\u0027\u0027 like us should not stain our lips with cursing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"SpongeBob: \u0027Yea verily\", \"priority\":4}]}, \"synonyms\":{}}");

