	add("sophistry", "{\"term\":\"sophistry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027sophistrie\u0027 from Latin \u0027sophista\u0027 from Ancient greek (to 1453) \u0027σοφιστής\u0027 (wise man) from \u0027σοφίζω\u0027 (i am wise) from \u0027σοφός\u0027 (wise)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Cunning, sometimes manifested as trickery\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Such conduct is at any rate not sophistical, if Aristotle be right in describing \u0027\u0027sophistry\u0027\u0027 as the art of making money.\u0026quot; 1844 - Søren Kierkegaard in Philosophical Fragments (Philosophiske Smuler eller En Smule Philosophi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The art of using deceptive speech or writing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An argument that seems plausible, but is fallacious or misleading, especially one devised deliberately to be so\", \"priority\":4}]}, \"synonyms\":{}}");

