	add("sophoi", "{\"term\":\"sophoi\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027σοφοί\u0027 (wise)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"since \u0027sophos\u0027 means “wise,” \u0027sophia\u0027 generally means “wisdom,” and \u0027\u0027\u0027sophoi\u0027\u0027\u0027 denotes “wise men” of any kind and in any field . As a consequence, he regards as having been the first of the \u0027\u0027\u0027sophoi\u0027\u0027\u0027 and the profession as having begun with the seven \u0027\u0027\u0027sophoi\u0027\u0027\u0027 of the . Given this understanding, the \u0027\u0027\u0027sophoi\u0027\u0027\u0027 stood in close relation to religious ritual as well as to linguistic, musical, and dramatic performance, and philosophy itself becomes first of all an advanced form of poetic discourse still submerged in mythical images\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"many who are now classified separately as , , or , but whom the Greeks would have grouped together under the term \u0027\u0027sophoi\u0027\u0027—“wise men.”\", \"priority\":2}]}, \"synonyms\":{}}");

	add("sophomania", "{\"term\":\"sophomania\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A delusion of superior intelligence\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sophont", "{\"term\":\"sophont\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027σοφός\u0027 (wise) + \u0027ὤν\u0027 (on) present participle of \u0027εἰμί\u0027 (being, existing, essence) First used in the 1966 works by w:Poul Anderson|Poul Anderson, coined by his wife Karen Anderson.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An intelligent being; a being with a base reasoning capacity roughly equivalent to or greater than that of a human being. The word does not apply to machines unless they have true artificial intelligence, rather than mere processing capacity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, w:David David Brin, Sundiver\u0027, p5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I\u0027m honored to meet a \u0027\u0027sophont\u0027\u0027 of the Soro line in person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, w:Vernor Vernor Vinge, \u0027w:A Fire Upon the A Fire Upon the Deep\u0027, Tor Books, p40\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Evil, they argued, could only have meaning on smaller scales, in the hurt that one \u0027\u0027sophont\u0027\u0027 does to another\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, w:Spider Spider Robinson, \u0027Lifehouse\u0027, Baen Books, p\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Only one \u0027\u0027sophont\u0027\u0027 appeared to be involved\u0026amp;mdash;and not a sophisticated one\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Howard Tayler \u0027w:Schlock Schlock Mercenary\u0027, Mar. 28, 2004, web-comic / self-publishe\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Like most sensible \u0027\u0027sophonts\u0027\u0027, they invented civilization. With civilization came civility, civil service, and of course civil war\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Howard Tayler, \u0027w:Schlock Schlock Mercenary\u0027, Nov. 30, 2007, web-comic / self-publishe\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"As I understand it, he sought to avoid turning one-point-six trillion terran \u0027\u0027sophonts\u0027\u0027 into undead, war-mongering super-soldiers\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Howard Tayler, \u0027w:Schlock Schlock Mercenary\u0027, Oct. 11, 2009, web-comic / self-publishe\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Reflection on the nature of sapience, and the ubiquity of violence among \u0027\u0027sophonts\", \"priority\":13}]}, \"synonyms\":{}}");

	add("sophophobia", "{\"term\":\"sophophobia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027σοφία\u0027 + English \u0027-phobia\u0027 (fear) compare \u0027phobosophy\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fear of learning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, July 24th: \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://groups.google.co.uk/groups/profile?hl\u003den\u0026amp;enc_user\u003dcpuT-RgAAACRPaY7sCCMbXaYuuvlEq72NWPAScTTKI3qwbmDrlAg-Q mary.elizabeth], \u0027[http://groups.google.co.uk/group/sci.med.aids/topics?hl\u003den sci.med.aids (Google group)]: [http://groups.google.co.uk/group/sci.med.aids/browse_thread/thread/29e9dd2ef92d096c/74f69f79cf26da2d?hl\u003den\u0026amp;q\u003d%22sophophobia%22 From the Editor]\u0026lt;/span\u0026gt;\u0027, 8:00a\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Washington insiders should note that the new Presidential Advisory Council is the Administration’s second effort to form an advisory group. When one of the Administration’s staffers reviewed the original list of committee nominees, the President was informed that two of the nominees had already died and one was close to death. When I discussed the original nominations with the staffer who ultimately decided to protect the White House from this gaffe, I recommended that he let the deceased nominees go through to illustrate the Executive Office’s lack of sensibility of and sensitivity to the reality of the AIDS pandemic. If my advice would have been taken, President Clinton could have excused himself on the basis of his \u0027\u0027sophophobia\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, December 11th: \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://groups.google.co.uk/groups/profile?hl\u003den\u0026amp;enc_user\u003dgdm0_BMAAAB0eUtXJeWI-h_2D_AiWzUbWMj6vob75xS36mXc24h6ww Robert Knowles], \u0027[http://groups.google.co.uk/group/ok.general/topics?hl\u003den ok.general (Google group)]: [http://groups.google.co.uk/group/ok.general/browse_thread/thread/a1c6bc3280482fef/dfc907b861fa0332?hl\u003den\u0026amp;q\u003d%22sophophobia%22\u0026amp;pli\u003d1 BumbleFrank Goes on Bended Knee]\u0026lt;/span\u0026gt;\u0027, 10:36p\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Yeah, I’ve learned to downplay the “edgykashun” angle here. Especially since the vast majority of mine was obtained outside Oklahoma, where I might have been exposed to dangerous outside ideas.\u0026lt;br/\u0026gt;Fortunately, my experience in ‛Bama taught me to recognize the symptoms of \u0027\u0027sophophobia\u0027\u0027, so I have learned to adapt and only reveal my “credentials” to those similarly endowed.\u0026lt;br/\u0026gt;So, show me yours and I’ll show you mine\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: H.W. Benjamin, \u0027Mamasense\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dZJH5jjOqs8YC\u0026amp;pg\u003dPA274\u0026amp;dq\u003d%22sophophobia%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003d2F0WTPmOMpWgzgToqJjWBA\u0026amp;cd\u003d2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sophophobia%22\u0026amp;f\u003dfalse page 274]\u0026lt;/span\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"“Justin, you don’t wanna mess with her,” the girl warned, “not only is she smart, she got 3 brothers who’ll kick the shit outa\u0026lt;!-- [sic] --\u0026gt; you once they get out the penitentiary. You’d better concentrate on your own case of \u0027\u0027sophophobia\u0027\u0027, Justin, and stop worryin whether Halle Jackson’s got a fear of sexual intercourse\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027: Albert R Koch, \u0027Help Mom with the Dishes: Lessons from Life’s Classroom\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dsjkUj3V4SqkC\u0026amp;pg\u003dPA26\u0026amp;dq\u003d%22sophophobia%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003d2F0WTPmOMpWgzgToqJjWBA\u0026amp;cd\u003d2\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sophophobia%22\u0026amp;f\u003dfalse page 26]\u0026lt;/span\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A little-known fact is that one of the fastest growing phobias in modern America is ballistophobia — fear of bullets. Especially when they are fired directly at you! That fear is right up there with \u0027\u0027sophophobia\u0027\u0027 — fear of learning. Today, a considerable number of school-age kids suffer terribly from this phobia\", \"priority\":11}]}, \"synonyms\":{}}");

